import React from 'react';

const Experience = () => {
  const experiences = [
    {
      id: 1,
      title: 'Senior Full Stack Developer',
      company: 'TechCorp Solutions',
      date: '2022 - Present',
      description: 'Lead development of scalable web applications using React, Node.js, and cloud technologies. Mentored junior developers and implemented CI/CD pipelines. Improved application performance by 40% and reduced deployment time by 60%.'
    },
    {
      id: 2,
      title: 'Full Stack Developer',
      company: 'Digital Innovations Inc.',
      date: '2020 - 2022',
      description: 'Developed and maintained multiple client projects using modern JavaScript frameworks. Collaborated with design teams to implement responsive UIs and optimized database queries for better performance.'
    },
    {
      id: 3,
      title: 'Frontend Developer',
      company: 'WebCraft Studios',
      date: '2019 - 2020',
      description: 'Specialized in React and Vue.js development, creating interactive user interfaces and implementing state management solutions. Worked closely with UX designers to ensure pixel-perfect implementations.'
    },
    {
      id: 4,
      title: 'Junior Developer',
      company: 'StartupXYZ',
      date: '2018 - 2019',
      description: 'Started my professional journey working on various web projects using HTML, CSS, JavaScript, and PHP. Gained experience in version control, testing, and agile development methodologies.'
    }
  ];

  return (
    <section id="experience" className="section experience">
      <div className="container">
        <h2 className="section-title">Work Experience</h2>
        <div className="section-content">
          <p style={{ fontSize: '1.1rem', color: '#6b7280', marginBottom: '2rem' }}>
            My professional journey in software development
          </p>
          <div className="experience-timeline">
            {experiences.map((exp) => (
              <div key={exp.id} className="experience-item">
                <div className="experience-content">
                  <div className="experience-date">{exp.date}</div>
                  <h3 className="experience-title">{exp.title}</h3>
                  <p className="experience-company">{exp.company}</p>
                  <p className="experience-description">{exp.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Experience;
